import React, { Component } from 'react';
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";
import Routes from "./Routes";

import './custom.css'


export default class App extends Component {
  static displayName = App.name;

  render () {
      return (
          <Routes />
      );
  }
}
